INSERT INTO `pokemons` VALUES ('1', 'Bulbasaur', 'BULBASAUR', 'Seed', 'Bulbasaur can be seen napping in bright sunlight. There is a seed on its back. By soaking up the sun\'s rays, the seed grows progressively larger.', 'GRASS', 'POISON', '45', '49', '49', '45', '65', '65', '45', '0', '70', 'Parabolic', '5355', 'Green', 'Grassland', '0', '0', '0', '0', '1', '0', 'CHLOROPHYLL', '1,7', '1', '7', 'FemaleOneEighth', '0', '25', '0');
INSERT INTO `pokemons` VALUES ('2', 'Ivysaur', 'IVYSAUR', 'Seed', 'To support its bulb, Ivysaur\'s legs grow sturdy. If it spends more time lying in the sunlight, the bud will soon bloom into a large flower.', 'GRASS', 'POISON', '60', '62', '63', '60', '80', '80', '45', '0', '70', 'Parabolic', '5355', 'Green', 'Grassland', '0', '0', '0', '0', '1', '1', 'CHLOROPHYLL', '1,7', '1', '13', 'FemaleOneEighth', '0', '21', '0');
INSERT INTO `pokemons` VALUES ('3', 'Venusaur', 'VENUSAUR', 'Seed', 'Venusaur\'s flower is said to take on vivid colors if it gets plenty of nutrition and sunlight. The flower\'s aroma soothes the emotions of people.', 'GRASS', 'POISON', '80', '82', '83', '80', '100', '100', '45', '0', '70', 'Parabolic', '5355', 'Green', 'Grassland', '0', '0', '0', '0', '2', '1', 'CHLOROPHYLL', '1,7', '2', '100', 'FemaleOneEighth', '0', '9', '0');
INSERT INTO `pokemons` VALUES ('4', 'Charmander', 'CHARMANDER', 'Lizard', 'The flame that burns at the tip of its tail is an indication of its emotions. The flame wavers when Charmander is happy, and blazes when it is enraged.', 'FIRE', 'null', '39', '52', '43', '65', '60', '50', '45', '0', '70', 'Parabolic', '5355', 'Red', 'Mountain', '0', '0', '0', '1', '0', '0', 'SOLARPOWER', '1,14', '1', '8', 'FemaleOneEighth', '0', '21', '0');
INSERT INTO `pokemons` VALUES ('5', 'Charmeleon', 'CHARMELEON', 'Flame', 'Without pity, its sharp claws destroy foes. If it encounters a strong enemy, it becomes agitated, and the flame on its tail flares with a bluish white color.', 'FIRE', 'null', '58', '64', '58', '80', '80', '65', '45', '0', '70', 'Parabolic', '5355', 'Red', 'Mountain', '0', '0', '0', '1', '1', '0', 'SOLARPOWER', '1,14', '1', '19', 'FemaleOneEighth', '0', '17', '0');
INSERT INTO `pokemons` VALUES ('6', 'Charizard', 'CHARIZARD', 'Flame', 'A Charizard flies about in search of strong opponents. It breathes intense flames that can melt any material. However, it will never torch a weaker foe.', 'FIRE', 'FLYING', '78', '84', '78', '100', '109', '85', '45', '0', '70', 'Parabolic', '5355', 'Red', 'Mountain', '0', '0', '0', '0', '3', '0', 'SOLARPOWER', '1,14', '2', '90', 'FemaleOneEighth', '0', '2', '0');
